def prep_filtered_dataset(ds, labels, indices, name):
    label_column = 'label' if 'label' in ds[0] else 'intent' if 'intent'  in ds[0] else 'fine_label' if 'fine' in name else 'coarse_label'
    print(f'For {name}, using label column {label_column}')
    filtered_ds = ds.filter(lambda x: x[label_column] in labels)[indices]
    assert len(filtered_ds[label_column]) == len(indices)
    assert set(filtered_ds[label_column]).issubset(labels)
    pd.DataFrame(filtered_ds).to_csv(f'{name}_test.csv', index=False)
    with open(f'{name}_labels.txt', 'w') as f:
        f.write(','.join([str(l) for l in labels]))

